#include <stdio.h>
#include <string.h>
#include <stdlib.h>
#include <stdbool.h>

bool ht[256];
bool noDoubleChar(char *s, int lens, int *d) {
    memset(ht, 0, sizeof(ht));

    for (int i = 0; i < lens; i++) {
        if (ht[s[i]])  {
            *d = i;
            return false;
        } else {
            ht[s[i]] = 1;
        }
    }
    return true;
}

int lengthOfLongestSubstring(char * s){
    int strlens = strlen(s);
    int maxLen = strlens;
    int i = maxLen;

    for (i = maxLen; i > 1; i--) {
        int d = 0;
        for (int j = 0; j + i <= strlens; j++) {
            int t;
            if (noDoubleChar(&s[j], i, &t)) {
                return i;
            } else {
                t = maxLen - t > t ? maxLen - t : t;
                d = d > t ? d : t;                
            }
        }
        maxLen = d;

    }
    return i;
};

